import React from 'react';
import './TimerOptions.css';

const WorkDurationOptions = ({ top, left, onClose }) => {
  return (
    <div className="options-view" style={{ top, left }}>
      <ul>
        <li>15 minutes</li>
        <li> 20 minutes </li>
        <li> 25 minutes </li>
        <li>30 minutes </li>
        <li>45 minutes</li>
        <li>60 minutes </li>
        <li> 75 minutes </li>
        <li> 90 minutes </li>
        <li onClick={onClose}>Close</li>
      </ul>
    </div>
  );
};

export default WorkDurationOptions;
